import React, {Component} from 'react';
import './Nav.css';
export default class Nav extends Component {
    render() {
      return(
        <div className="Nav">
          <div className="Nav-category-tab">category</div>
          <ul className="Nav-category-items">
            <li className="Nav-category-item">category1</li>
            <li className="Nav-category-item">category2</li>
          </ul>
          <p className="Nav-category-foot">foot</p>
        </div>
      )
    }
  }
